    rn_facilities (name, phone, ext, fax, address_line_1, address_line_2, city, state, zip, website, npi, inserted_at, updated_at)
SELECT distinct on (facility)
    trim(facility)
  , trim(facility_phone)
  , NULL
  , trim(facility_fax)
  , trim(facility_address_line)
  , trim(facility_address_line_2)
  , trim(facility_address_city)
  , trim(facility_address_state)
  , trim(facility_address_zip)
  , NULL
  , NULL
  , NOW()
  , NOW()
FROM
    junk.referral_facility_provider_list_final_20240708
order by facility
;

UPDATE
    junk.referral_facility_provider_list_final_20240708 j
SET
    rn_facility_id = f.id
FROM
    rn_facilities f
WHERE
    f.name = trim(j.facility);

