SELECT
    r0."id"
  , r1."id"
  , r1."full_name"
  , r1."dob"
  , r1."phone"
  , r3."full_name"
  , r2."name"
  , r4."name"
  , r9."full_name"
  , r0."referral_date"
  , r0."priority"
  , r8."name"
  , r5."name"
  , CASE WHEN r6."appointment_date" IS NOT NULL THEN r6."appointment_date"
         WHEN r7."appointment_date" IS NOT NULL THEN r7."appointment_date"
         ELSE NULL END
FROM
    "rn_patient_referrals" AS r0
    INNER JOIN "rn_patients" AS r1 ON r1."id" = r0."rn_patient_id"
    INNER JOIN "rn_locations" AS r2 ON r2."id" = r0."rn_referred_by_location_id"
    left JOIN "rn_providers" AS r3 ON r3."id" = r0."referring_provider_id"
    JOIN "rn_ref_specialty_types" AS r4 ON r4."key" = r0."specialty_type_key"
    JOIN "rn_ref_referral_statuses" AS r5 ON r5."key" = r0."referral_status_key"
    LEFT OUTER JOIN "rn_pr_internal_wfs" AS r6 ON r6."rn_patient_referral_id" = r0."id"
    LEFT OUTER JOIN "rn_pr_external_wfs" AS r7 ON r7."rn_patient_referral_id" = r0."id"
    LEFT OUTER JOIN "rn_facilities" AS r8 ON r8."id" = r0."rn_facility_id"
    LEFT OUTER JOIN "rn_providers" AS r9 ON r9."id" = r0."specialist_provider_id"
WHERE
    (r0."assigned_to_id" = 2);

